import 'dart:convert';

Character characterFromJson(String str) => Character.fromJson(json.decode(str));

String characterToJson(Character data) => json.encode(data.toJson());

class Character {
  Character({
    this.embedded,
    this.links,
    this.page,
  });

  Embedded embedded;
  CharacterLinksClass links;
  Page page;

  factory Character.fromJson(Map<String, dynamic> json) => Character(
    embedded: Embedded.fromJson(json["_embedded"]),
    links: CharacterLinksClass.fromJson(json["_links"]),
    page: Page.fromJson(json["page"]),
  );

  Map<String, dynamic> toJson() => {
    "_embedded": embedded.toJson(),
    "_links": links.toJson(),
    "page": page.toJson(),
  };
}

class Embedded {
  Embedded({
    this.characters,
  });

  List<CharacterElement> characters;

  factory Embedded.fromJson(Map<String, dynamic> json) => Embedded(
    characters: List<CharacterElement>.from(json["characters"].map((x) => CharacterElement.fromJson(x))),
  );

  Map<String, dynamic> toJson() => {
    "characters": List<dynamic>.from(characters.map((x) => x.toJson())),
  };
}

class CharacterElement {
  CharacterElement({
    this.character,
    this.frequencyRank,
    this.frequency,
