    this.englishTranslation,
    this.links,
  });

  String character;
  int frequencyRank;
  int frequency;
  double frequencyPercentage;
  double cumulativePercentage;
  String pinyin;
  String englishTranslation;
  CharacterLinks links;

  factory CharacterElement.fromJson(Map<String, dynamic> json) => CharacterElement(
    character: json["character"],
    frequencyRank: json["frequencyRank"],
    frequency: json["frequency"],
    frequencyPercentage: json["frequencyPercentage"].toDouble(),
    cumulativePercentage: json["cumulativePercentage"].toDouble(),
    pinyin: json["pinyin"],
    englishTranslation: json["englishTranslation"],
    links: CharacterLinks.fromJson(json["_links"]),
  );

  Map<String, dynamic> toJson() => {
    "character": character,
    "frequencyRank": frequencyRank,
    "frequency": frequency,
    "frequencyPercentage": frequencyPercentage,
    "cumulativePercentage": cumulativePercentage,
    "pinyin": pinyin,
    "englishTranslation": englishTranslation,
    "_links": links.toJson(),
  };
}

